            const {navigation}=props;
            const {state,setParams}=navigation;
            const {params}=state;
            return {
                title:params.title?params.title:"This is Page3",
                headerRight:(
                    setParams({mode:params.mode==='edit'?'':'edit'})}
                    />
                )
            }
        }
    },
    Page4:{
        screen: Page4,
        navigationOptions:{
            title:"This is Page4"
        }
    },
