        screen:AppBottomNavigator,
            navigationOptions: {
            title: 'BottomNavigator'
            }
        },
        Top:{
            screen:AppTopNavigator,
            navigationOptions: {
                title: 'TopNavigator'
            },

        },DrawerNav:{
            screen:DrawerNav,
            navigationOptions:{
                title:'DrawerNav'
            }
        }
    },
    {
    initialRouteName: 'HomePage', // 设置 stack navigator 的默认页面， 必须是路由配置中的某一个
    }
);


